import "./App.css";
import { ArweaveWalletKit } from "arweave-wallet-kit";
function App() {
  return (
    <div className="App">
      <ArweaveWalletKit>
        <ConnectButton
          accent="rgb(255, 0, 0)"
          profileModal={false}
          showBalance={true}
        />
      </ArweaveWalletKit>
    </div>
  );
}

export default App;
